import React from "react";
import logo from './logo.svg';
import './App.css';

import StatusBar from "./StatusBar";
import QnA from "./QnA";
import Result from "./Result";
import Start from "./Start"

 const App = (props) => {
  return(
    <div className="App">
        <Start></Start>
      <StatusBar></StatusBar>
      <QnA></QnA>
      <Result></Result>
  </div>
  );
}

export default App;
//브랜치 생성
